import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const NONPROFIT_INDUSTRIES = {
  "Technology & Software":
    "Software Development, Information Technology & Services, Computer & Network Security, Computer Games, Internet, Semiconductors, Telecommunications",
  "Finance & Banking":
    "Banking, Investment Banking, Investment Management, Financial Services, Insurance",
  "Healthcare & Pharmaceuticals":
    "Hospital & Health Care, Medical Devices, Pharmaceuticals, Alternative Medicine, Biotechnology",
  "Education & Research":
    "Higher Education, E-Learning, Research, Primary/Secondary Education, Think Tanks",
  "Manufacturing & Engineering":
    "Manufacturing, Mechanical or Industrial Engineering, Automotive, Aviation & Aerospace",
  "Retail & Consumer Goods":
    "Retail, Consumer Goods, Food & Beverages, Luxury Goods & Jewelry, Apparel & Fashion",
  "Media & Entertainment":
    "Media Production, Broadcast Media, Publishing, Entertainment, Music, Motion Pictures & Film",
  "Government & Nonprofit":
    "Government Administration, Non-profit Organizations, Public Policy, International Affairs",
  "Energy & Environment":
    "Renewables & Environment, Oil & Energy, Environmental Services, Utilities, Mining & Metals",
  "Construction & Real Estate":
    "Construction, Real Estate, Architecture & Planning, Civil Engineering",
  "Transportation & Logistics":
    "Transportation/Trucking/Railroad, Maritime, Airlines & Aviation, Logistics & Supply Chain",
  "Legal & Consulting":
    "Legal Services, Management Consulting, Alternative Dispute Resolution, Accounting",
};

const FORPROFIT_INDUSTRIES = {
  "Technology & Software":
    "Software Development, Information Technology & Services, Computer & Network Security, Computer Games, Internet, Semiconductors, Telecommunications",
  "Finance & Banking":
    "Banking, Investment Banking, Investment Management, Financial Services, Insurance",
  "Healthcare & Pharmaceuticals":
    "Hospital & Health Care, Medical Devices, Pharmaceuticals, Alternative Medicine, Biotechnology",
  "Education & Research":
    "Higher Education, E-Learning, Research, Primary/Secondary Education, Think Tanks",
  "Manufacturing & Engineering":
    "Manufacturing, Mechanical or Industrial Engineering, Automotive, Aviation & Aerospace",
  "Retail & Consumer Goods":
    "Retail, Consumer Goods, Food & Beverages, Luxury Goods & Jewelry, Apparel & Fashion",
  "Media & Entertainment":
    "Media Production, Broadcast Media, Publishing, Entertainment, Music, Motion Pictures & Film",
  "Government & Nonprofit":
    "Government Administration, Non-profit Organizations, Public Policy, International Affairs",
  "Energy & Environment":
    "Renewables & Environment, Oil & Energy, Environmental Services, Utilities, Mining & Metals",
  "Construction & Real Estate":
    "Construction, Real Estate, Architecture & Planning, Civil Engineering",
  "Transportation & Logistics":
    "Transportation/Trucking/Railroad, Maritime, Airlines & Aviation, Logistics & Supply Chain",
  "Legal & Consulting":
    "Legal Services, Management Consulting, Alternative Dispute Resolution, Accounting",
};

export default function ProfileTypePage() {
  const navigate = useNavigate();
  const { user } = useAuth();
  const [selectedType, setSelectedType] = useState("");
  const [selectedIndustry, setSelectedIndustry] = useState("");
  const [showIndustries, setShowIndustries] = useState(false);

  useEffect(() => {
