    if (!user) {
      console.log("Êú™Ê£ÄÊµãÂà∞Áî®Êà∑ÔºåÂáÜÂ§áÈáçÂÆöÂêëÂà∞ÁôªÂΩïÈ°µÈù¢");
      navigate("/signin");
    } else {
      console.log("Ê£ÄÊµãÂà∞Áî®Êà∑ÔºåÂÖÅËÆ∏ËÆøÈóÆÈ°µÈù¢");
    }
  }, [user, navigate]);

  const handleTypeSelect = (type) => {
    setSelectedType(type);
    setShowIndustries(true);
  };

  const handleIndustrySelect = (industry) => {
    setSelectedIndustry(industry);
    localStorage.setItem("orgType", selectedType);
    localStorage.setItem("industry", industry);
    navigate("/profile-setup/details");
  };

  const industries =
    selectedType === "nonprofit" ? NONPROFIT_INDUSTRIES : FORPROFIT_INDUSTRIES;

  return (
    <div className="min-h-screen flex items-center justify-center px-4 sm:px-6 lg:px-8">
      <div className="max-w-3xl w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-bold text-gray-900">
            Tell us about your organization
          </h2>
          <p className="mt-2 text-center text-sm text-gray-600">
            Select your organization type to help us provide better partnership
            matches
          </p>
        </div>

        {!showIndustries ? (
          <div className="mt-8 grid grid-cols-2 gap-4">
            <button
              onClick={() => handleTypeSelect("nonprofit")}
              className="flex items-center justify-center px-8 py-6 border-2 border-gray-300 rounded-xl hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
            >
              <div className="text-left">
                <span className="text-2xl mb-2">üåç</span>
                <h3 className="text-lg font-medium text-gray-900">
                  We're Nonprofits
                </h3>
                <p className="text-sm text-gray-500">
                  NGOs, charities, and social organizations
                </p>
              </div>
            </button>

            <button
              onClick={() => handleTypeSelect("for-profit")}
              className="flex items-center justify-center px-8 py-6 border-2 border-gray-300 rounded-xl hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
            >
              <div className="text-left">
                <span className="text-2xl mb-2">üíº</span>
                <h3 className="text-lg font-medium text-gray-900">
                  We're For-Profits
                </h3>
                <p className="text-sm text-gray-500">
                  Companies and businesses looking to make an impact
                </p>
              </div>
            </button>
          </div>
        ) : (
          <div className="mt-8">
            <h3 className="text-xl font-medium text-gray-900 mb-4">
              Select your industry
            </h3>
            <div className="grid grid-cols-2 gap-4">
              {Object.entries(industries).map(
                ([category, includedIndustries]) => (
                  <button
                    key={category}
                    onClick={() => handleIndustrySelect(category)}
                    className="text-left p-6 border-2 border-gray-300 rounded-xl hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
                  >
                    <h4 className="text-lg font-medium text-gray-900 mb-2">
                      {category}
                    </h4>
                    <p className="text-sm text-gray-500">
                      {includedIndustries}
                    </p>
                  </button>
                )
              )}
            </div>
            <button
              onClick={() => setShowIndustries(false)}
              className="mt-6 text-sm text-gray-500 hover:text-gray-700"
            >
              ‚Üê Back to organization type selection
            </button>
          </div>
        )}
      </div>
    </div>
  );
}
